                        "shared_profile_url": "https://www.linkedin.com/in/mateinkhalid",
                        "shared_company_url": "",
                        "text": "It is a horrifying thought but exchange data tells that one investor is positioning for the launch of a tactical nuclear missile in Ukraine by March 2023. This investor has paid 19 cents per contract for 50,000 CBOE Volatility Index (VIX) 150 strike call options that expire in March 2023. Let me translate this trade into English. Somebody out there expects the Volatility Index to rise from its current 32 to as high as 150 by March 2023. No typo, 150 on VIX. This trade sent a chill up my spine as we have never seen the stock market's pendulum of greed and fear spike up to 150, not even on the day Al Qaida terrorist attacked the WTC/Pentagon on 9/11 2001 or when Lehman failed on 9/15 2008. The only credible scenario for a 150 VIX would be a Kremlin nuclear strike as Putin has threatened the world multiple times voicing the unthinkable that not even Stalin, Khrushchev or Brezhnev ever dared to do in the Cold War.Either it is Russian intelligence operatives building a position on VIX because they know something we do not or a billionaire on this superyacht somewhere in the Indian Ocean has hedged for a stock market collapse on a scale the world has never seen. Dow Jones fell 22% in a single session on Black Monday, Oct 19, 1987. The VIX at 150 means the Dow Jones would fall 50% since a mushroom cloud in Europe suggests somebody has fired a nuclear weapon in anger for the third time in human history since Hiroshima and Nagasaki.The eerie thing is that there have been several follow-on trades that have aped the 150 VIX doomsday trade. Eg, an investor bought 5500 Jan 120 strike VIX call options. Just to give my friends a sense of perspective since I have traded vol products since the late-1990's. The VIX spiked to 80 in November 2008 when Bush's first TARP bailout plan was rejected by Congress even as the banking dominoes began to fail, exactly as they had when Creditanstalt, the Rothschild bank in Vienna, failed in 1931 on the eve of the Great Depression and the Third Reich. So the idea of someone betting that the VIX can rise to 150 horrifies me to no end. I just hope it is some paranoid, depressive, HIV positive, Uncle Scrooge billionaire who has executed this trade in a psychedelic drug induced mania.If a rational investor thinks 120 let alone 150 VIX is possible in 2023, the world is lost. Do you think I should write a screenplay based on this very real time event for a close friend who happens to own a content IP studio in Hollywood and loves spy thriller plots? Imagine a wannabe James Bond zipping around the Côte d'Azur hunting down a bare chested bald evil dictator known as Dr. Vlado the Baddo who hopes to make a billion dollars in VIX options by launching a nuclear cruise missile from the bridge of his superyacht moored off my beloved Cap d'Antibes? Hopefully, the VIX option expiration date is not our specie's expiration moment in March 2023.",
