                        "shared_profile_url": null,
                        "shared_company_url": null,
                        "text": "Atlassian's sales and marketing costs are a fraction of their peers.Here's how they grew to $30B on an efficient GTM budget 👇At IPO, Atlassian was spending only 19% of its revenue on sales and marketing. Similar-sized companies spent 50%+.They were already doing $320m ARR and growing 60% yoy.In today's economy, as budgets get slashed, it's worth taking a page out of their book. Here are some lessons:1️⃣ Product-led growth requires a remarkable productAtlassian realized early on that their products could sell themselves. Here's what Atlassian's President Jay Simons said- \"We chose the word ‘remarkable’ with intention. We wanted to build a product that people felt compelled to remark upon. That would then build word of mouth which would help us acquire more customers.\"2️⃣ Layer sales onto PLG strategicallyAtlassian understood its customer base well. They tend to be devs or people who worked on technology.These buyers were savvy and did their own research.Atlassian believed 65% of the sales cycle happened even before any interaction with the customer.Therefore, they focused on:- Education through content- Flexible pricing so users of any budget can onboard- Qualifying deals so only the most complex enterprise deals get touched by sales3️⃣ A transparent pricing modelMost SaaS companies at the time didn't put pricing numbers online. Many still don't today.And it makes sense - companies don't want competitors to undercut them, and they want to be able to create custom deals for each buyer.However, Atlassian decided transparency was worth the tradeoffs. They were okay with losing some customers because of pricing. The upside is less back-and-forth between sales and buyers, and much faster velocity. Enterprise customers often spent $10k+ without talking to sales.What other tactics are you aware of, that help to keep sales and marketing efficient? #sales #marketing #productledgrowth",
