      "title": "PathMatch",
      "website": "http://www.pathmatch.com",
      "about": "53% of college graduates don’t get jobs, even when they have specialized majors which in theory should get them employed.  That’s because it’s just not enough to graduate with a degree. Companies use complex software to do the work that previous entry-level grads used to do. You now need to know how to use this software and unfortunately, the only way you demonstrate proficiency is through internships. \n\nPathMatch is building the largest early career talent platform connecting students to modern careers, skills, and companies. Students create their video-enhanced PathMatch profile which is easier for companies to search and schedule interviews. PathMatch profiles become a 1-click application for students to apply to internships and jobs, reducing the amount of time it takes.\n\nFor companies: University recruiting is tough! Students are not engaged with their career centers and often don’t know what they want to do, which makes it harder to decide whether or not you want to bring them on as an intern or new grad hire. PathMatch gives you greater insight into students/new grads so you can go from post to matched candidates in minutes.\n\nWe’re simplifying campus recruiting! Helping millions of students connect with internships and jobs.",
